script: |
  super -f tsv -I q3386.sql | sort > q3386.out

vector: true

inputs:
  - name: q3386.sql
    data: |
      SELECT + cor0.col0 * NULLIF ( + COALESCE ( cor0.col0, + cor0.col0 ), CAST ( NULL AS INTEGER ) * 87 ) AS col0 FROM tab1 AS cor0 GROUP BY cor0.col0;
  - name: tab1

outputs:
  - name: q3386.out
    data: |
      484
      6724
      784
